@Валя Ус Но его эта угроза ничуть не смущает, выходит? 
То есть, Навальные ведь, при таком раскладе, должен пользоваться любой возможностью, что бы поправки не прошли, но он не делает ничего, нет?
Ну как ничего, призывает закрыть глаза, как будто 1 июля ничего не произойдет.

@Александр Ларкин 
Твой. И Гитлера.
Молись там чаще.

@007  - лигитимно любое голосование, а вот использовать его результаты для принятия анстиконституционных законов - нелигитимно. Другими словами - если большинство проголосует "против" - пойдут эти законотворцы лесом, а в перспективе и в тюрьму. Если "за" - следующим действием может быть только референдум, это "за" не позволяет изменить конституцию.
Что касается наблюдателей, кто-то упорно распускает слухи, что их быть не может, так как не зарегистрируют. Мне в это верится с трудом.
"Оппозиция" же в лице Лёши, который давно стал врагом народа, или яшина, который предал народ только на днях - это обман для простаков, которые думают, что если Лёша хорошо борется против коррупции, то он так же хорош в плане политика. Нет, как политик он - предатель, матёрый, возможно, что и не за деньги, а по глупости, но так оно и есть, коль он призывает территории с русскими людьми раздавать. Был бы другой, я бы назвал его подонком, но этот - просто придурок.

@Tokado Qo 
Проще не бывает.
У людей не должно быть ощущения причастности к этой афере. Любое участие (за/против) добавляет афере легитимности. Именно поэтому множество платных бобиков Путина (Зюганов, например), призывают голосовать "Против"... ну или "За".

@Game Gang ситуация в Америке прекрасно показывает, какое это "замечательное" место для жизни.
Если у нас большинство населения раболепное стадо, которое устраивает "бойкот" тем, что сидит дома и молчит в тряпочку, в Америке все дошло до другой крайности, когда из-за одного ужасного случая, разгромляют всю страну.
А вообще не все хотят как крысы бежать в другую страну, нужно превращать эту в правовое демократическое государство! И голосовать против поправок, которые отдаляют нас от этого еще дальше!

@Александр //// В ст.81 - Президент может находиться на своём посту не более двух сроков подряд, но для действующего ныне президента это правило не коснётся, так как предыдущие соответствующие статьи конституции утрачивают свою силу (обнуляются). Это значит Путин будет иметь конституционное право участвовать в выборах президента 2024 и 2030 года.

Все поправки уже одобрены в Думе, Совете Федерации и Конституционном Суде и, фактически, вступили в силу. Другими словами – решение уже принято.

Всероссийское голосование, какие бы не были его результаты, не имеет юридической силы. Такую силу мог бы иметь Референдум, но его не будет.

@Mikhail Rozhin 
Да потому что САМ ПУТИН просит народ прийти на его фальшивый референдум. Голос за/против не суть важен.

Задача, поставленная кремлеботам - раздробить протестное движение. Отломить от антикоррупционной общественности, выстроившейся за бесспорным лидером Алексеем Навальным, как можно БОЛЬШИЙ КУСОЧЕК.

@Victor Lecavalier объясните свою позицию логично. Чем вы поможете, если не пойдете голосовать против?
Объясните просто какой возможный практический результат это даст?
Я объясню свою позицию. Мы идем голосовать против, потому что я верю, что может и мизирный, но шанс все таки есть, что ничего не приняли и мы можем этому помешать! Ради этого шанса я пойду. А мы, все кто против, останемся дома, просто будет перевес в сторону тех, кто голосует за. Низкой явки нет, это факт. Нигде это не прописано, поищите сами, если не верите на слово. Мой вопрос: ТОГДА В ЧЕМ СОСТОИТ ВАШ БОЙКОТ?

Alex Voznesensky 
Эти слова Шульман сказала о выборах ВООБЩЕ, а не об этом голосовании
Сейчас решение уже принято, уже законы на основании этой Конституции приняты!
То, что написано на заборе, не всегда за ним находится.
Неужели вы думаете, что:
1. Не нарисуют столько голосов ЗА, сколько им нужно;
2. Дадут проконтролировать результаты;
3. Если даже вы каким-то чудом узнаете про масштаб фальсификаций, то наш «суд» отменит результаты;
4. Путин признает результаты, если голосов ПРОТИВ будет больше чем ЗА, и отзовёт свою подпись под законом о принятии поправок;
5. Дума и Совфед отменят своё решение о принятии поправок и законы, принятые на их основании;
6. Все напечатанные и разосланные в магазины и библиотеки экземпляры новой Конституции изымут оттуда и сожгут ?
В такое нормальный человек поверить не может.
Явка им нужна, да не просто цифра (нарисуют, как и голоса), а картинка, как вдохновлённые толпы рвутся голосовать 
В ход идут и диды, и детишки, и котики, артисты, блогеры (всем заплатили денег, а ещё больше по обыкновению, распилили), а денег не жалеют: помочь людям на карантине - бюджеты треснут, а раздавать 10 млрд в одной только Москве. Уже одно только это говорит о том, насколько им нужна ЯВКА (при том, что результат никого не волнует и его не проконтролировать).
Я уж про корону молчу...

