@Овечка Долли 
Не только про МРОТ. Ещё про животных и про язык. Зачем это все в конституцию? Ок, нужно туда запихнуть, ну так дайте мне выбор: с этим согласен, с этим не согласен. А-то я должен согласиться со всем и с обнулением одновременно. Что за идиотская поправка: с момента принятия поправок срок обнуляется. Что это вообще такое? А Вам все ничего страшного.
Ничего страшного, что он ещё 2 срока оттарабанит или, что мы его можем и не выбрать? Мне страшно первое, мне к 36 году будет к 60..., а на счет второго... вы реально верите, что у нас существуют выборы и борьба на этих выборах?...

@Полина Загитова 
Голосовать не идут не из-за того, что время не могут выбрать, а из-за того, что противно. Я когда 22 года назад окончил школу был очень политичен: ходил на голосования, смотрел заседания госдумы (можете себе представить), переживал, что примакову только 2 комитетских портфеля дали... А сейчас настолько все очевидно и противно...
Вы говорите о важных поправках... Это о том, что нельзя зп ниже мрота платить? А законом это нельзя отрегулировать? Конечно можно. Как и всё остальное. Даже так, то сделайте на против КАЖДОЙ поправки "да" или "нет", нет же, либо полностью за, либо против. Вы действительно не понимаете ради чего это?

