@Вадим Туманов Ничего там важного, кроме продления возможности царствовать не рассматривается. Туда напихали очевидные вещи, которые и без вписания в конституцию ДОЛЖНЫ работать, весь этот перечень вписанный - для отвода глаз от главной цели, т. е. переизбрания. 
